import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
//import LoginSignup from './components/logingsignup';

import AppHeader from './components/header';
import AppLogin from './loginsignup';
import AppItinerary from './components/itinerary';

function App() {
  return (
    <div className="App">
    <header id="header" >
     <AppHeader />
    </header>
    <main>
      <AppLogin />
      <AppItinerary />
    </main>
   </div>

  );
}

export default App;
